import React from 'react'
import './App.css';
import CDECard from './components/CDE';
import CDECard2 from './components/CDE2';
import CDECard3 from './components/CDE3';
import CDECard4 from './components/CDE4';
import CSVReader from 'react-csv-reader'
import jsonObject from './JSON/CDEContent.json'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>{jsonObject.setTitle}</h1>
        <div id="versions">
            <p className="version">1.0</p>
            <p className="version">2.0</p>
            <p className="version">3.0</p>
            <p className="version">4.0</p>
        </div>
        <CSVReader onFileLoaded={(data, fileInfo) => console.dir(data, fileInfo)} />
        <br/>

        {createLabel1(jsonObject.label1)}
        {createLabel2(jsonObject.label2)}

      </header>
    </div>
  );
}

function createLabel1(label: string) {
    return (
      <section className="labelCard"> 
            <h1>Label: {label}</h1>
            <div className="cards">
                <CDECard></CDECard>
                <CDECard></CDECard>
            </div>
      </section>
    )
}

function createLabel2(label: string) {
    return (
      <section className="labelCard"> 
            <h1>Label: {label}</h1>
            <div className="cards">
                <CDECard></CDECard>
                <CDECard></CDECard>
            </div>
      </section>
    )
}

export default App;
